// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
// import { faPenToSquare } from "@fortawesome/free-regular-svg-icons" ;
// import { faTrashCan } from "@fortawesome/free-regular-svg-icons" ;
import axios from "axios";
import React, { useEffect, useState } from "react";

export default function EmployeeDetails(){

    const [empInfo, setEmpInfo] = useState([]);
    const [empLeaveInfo, setEmpLeaveInfo] = useState([]);

    useEffect(() => {
        const fetchUser = async() => {
            const employeeId = window.localStorage.getItem("id");
            try{
                const [employeeDetails, leaveDetails] = await Promise.all([
                    axios.get(`http://localhost:5000/Employee_Details?id=${employeeId}`),
                    axios.get(`http://localhost:5500/Leave_Details?id=${employeeId}`)
                ]) 
                const welcomeMessage = document.getElementById("employeeDashboard");
                welcomeMessage.innerText = "Welcome "+ employeeDetails[0].FirstName + employeeDetails[0].LastName + " (" + employeeDetails[0].id + ")";
                    //const headingDiv = document.createElement("h4");
                    //headingDiv.classList.add("formHeading", "mb-4");
                    //headingDiv.style.float = "right";
                    //var text = document.createTextNode("Welcome "+ response[0].FirstName + response[0].LastName + " (" + response[0].id + ")");
                    //headingDiv.appendChild(text);
                    //welcomeMessage.appendChild(headingDiv);
                setEmpInfo(employeeDetails);
                setEmpLeaveInfo(leaveDetails);
            }catch(error) {
                console.error(error.message);
            }
        }
        fetchUser();
    }, [])
    console.log()
    return(
        <>
            <div className="row">
                <h4 id="employeeDashboard" className="formHeading mb-4" style={{textAlign:"right"}}>Welcome</h4>
                {/* <div className="col-1"></div> */}
                <div className="col-5">
                    
                            <h4 className="mt-4 mb-4 formHeading">Personal Details</h4>
                            <table>
                                <tbody className="employeeDetails">
                                    <tr>
                                        <td>First Name</td>
                                        <td>{empInfo[0]?.FirstName}</td>
                                    </tr> 
                                    <tr>
                                        <td>Last Name</td>
                                        <td>{empInfo[0]?.LastName}</td>
                                    </tr>
                                    <tr>
                                        <td>Personal Email</td>
                                        <td>{empInfo[0]?.Email}</td>
                                    </tr> 
                                    <tr>
                                        <td>Designation</td>
                                        <td>{empInfo[0]?.Designation}</td>
                                    </tr> 
                                    <tr>
                                        <td>Base Location</td>
                                        <td>{empInfo[0]?.BaseLocation}</td>
                                    </tr> 
                                    <tr>
                                        <td>Gross Salary</td>
                                        <td>{empInfo[0]?.Salary}</td>
                                    </tr> 
                                    <tr>
                                        <td>Joining Date</td>
                                        <td>{empInfo[0]?.JoiningDate}</td>
                                    </tr>  
                                </tbody>
                            </table>
                        
                </div>
                <div className="col-6">
                    <h4 className="mt-4 mb-4 formHeading">Leave Request</h4>

                </div>
            </div>
        </>
    );
}
